$(document).ready(function () {
	const $template = $("#itemTemplate"),
		_template = _.template($template.html()),
		$container = $(".container");

	data.forEach((patient) => {
		$container.find("#boxes").append(_template({ person: patient }));
	});

	$("#expenses").on("click", function (e) {
		e.preventDefault();

		$(".item.active").removeClass("active");

		most_expensive.forEach((patient, index) => {
			const id = `#${patient.sex}-${patient.age}-${patient.bmi}`;
			$(id).addClass("active").css({ order: (index + 1) });
		});
	});

	$("#male").on("click", function (e) {
		e.preventDefault();

		$(".item.active").removeClass("active");

		const male = _.filter(data, { sex: "male" });

		male.forEach((patient, index) => {
			const id = `#${patient.sex}-${patient.age}-${patient.bmi}`;
			$(id).addClass("active");
		});
	});
});